"""## **Customizing tokenizer**"""

nlp = spacy.blank("en")

doc = nlp("gimme double cheese extra large healthy pizza")
tokens = [token.text for token in doc]  #list comprehension / loop inside a list
tokens

"""#### we can cutomize spacy in some cases like identify single word as combination of 2 words and split it into that 2 words"""

from spacy.symbols import ORTH  #need this library

nlp.tokenizer.add_special_case("gimme", [
    {ORTH: "gim"},
    {ORTH: "me"},
])
doc = nlp("gimme double cheese extra large healthy pizza")
tokens = [token.text for token in doc]
tokens

#the word gimme is a combination of give + me
#as the error shown below we cannot modify the original token / word

#ValueError: [E997] Tokenizer special cases are not allowed to modify the text.
#This would map 'gimme' to 'giveme' given token attributes '[{65: 'give'}, {65: 'me'}]'.

"""### Sentence Tokenization or Segmentation"""

doc = nlp("RAG, AIOps and GenAI fileds are rapidly improving. data science is the sexiest job in 2022. Dr. strange is a marvel superhero")
for sentence in doc.sents:
    print(sentence)

#error occured
#ValueError: [E030] Sentence boundaries unset.
#You can add the 'sentencizer' component to the pipeline with: `nlp.add_pipe('sentencizer')`.
